import React from "react";

const Image = (props) => {
  return (
    <React.Fragment>
      <div
        className="m-2 md:bg-green-600 g-orange-600 md:block mx-auto md:mx-2"
        style={{ cursor: "pointer", width: "80vw", height: "53vw" }}
      >
        <p className="text-center">{props.projectData.name}</p>
        <p className="text-center">this is the image</p>
      </div>
      <div
        className="m-2 b md:hidden block  "
        style={{ cursor: "pointer", width: "80vw", height: "53vw" }}
      >
        <p className="text-center">{props.projectData.name}</p>
        <p className="text-center">this is the image</p>
      </div>
    </React.Fragment>
  );
};

export default Image;
